INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "春咲 ひより", 0, 1, 1001, 1.4, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 2, "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "草野 優衣", 0, 1, 1002, 1.4, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, 2, "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "士条 怜", 0, 1, 1003, 1.4, 1, 0, "フェンシングを始めてみては？", "少しは磨かれると思いますよ。", 0, 0, 2, "キミに必要な集中力と感性が");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "穂高 みそぎ", 0, 1, 1004, 1.5, 1, 0, "ねぇ、にいちゃん！", "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, 2, "今日はなにして遊ぶ？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "風宮 あかり", 0, 1, 1006, 1.4, 1, 0, "風宮あかりです", "私といっしょに…\nいかない？", 0, 0, 2, "ねぇ…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "出雲 宮子", 0, 1, 1007, 1.5, 1, 0, "出雲宮子なのー", "食べ物の恨みは怖いのー", 0, 0, 2, "プリンたべたいのー");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "虹村 雪", 0, 1, 1008, 1.4, 1, 0, "ボクは虹村雪。", "いいよ。\n見られることは運命さ…", 0, 0, 2, "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "柊杏奈", 0, 1, 1009, 1.4, 1, 0, "フッ…聞いて後悔するがいい！", "人呼んで「疾風の冥姫」!!", 0, 0, 2, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "姫宮 真歩", 0, 1, 1010, 1.5, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", "ほんまおおきにやわ～♪", 0, 0, 2, "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "衣之咲 璃乃", 0, 1, 1011, 1.4, 1, 0, "衣之咲璃乃です！", "ここで会ったが\n100年目～！", 0, 0, 2, "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "柏崎 初音", 0, 1, 1012, 1.4, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, 2, "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "美波 鈴奈", 0, 1, 1016, 1.4, 1, 0, "ちょす！\n美波鈴奈だよ～♪", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, 2, "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "喜屋武 香織", 0, 1, 1017, 1.4, 1, 0, "はいたーい。\n喜屋武香織さー。", "でも、沖縄もとってもいいとこさー", 0, 0, 2, "東京は遊園地みたいなところさー");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "支倉 伊緒", 0, 1, 1018, 1.4, 1, 0, "支倉伊緒です。", "イオちゃんって呼んでね。", 0, 0, 2, "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "茜 ミミ", 0, 1, 1020, 1.5, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "ミミをおいてかないでぇ～", 0, 0, 2, "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "栗林 くるみ", 0, 1, 1021, 1.5, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", "ふぇぇぇぇぇん……", 0, 0, 2, "あの……\nふぇ……");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "風宮 より", 0, 1, 1022, 1.4, 1, 0, "風宮よりです。\nあああああ！", "なんてありがとうございます！", 0, 0, 2, "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "北条 綾音", 0, 1, 1023, 1.5, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "私こっち行きたいー\nね、早く早くー", 0, 0, 2, "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "天野 すずめ", 0, 1, 1025, 1.4, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", "これて何か違う…\nあああすみません！", 0, 0, 2, "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "倉石 恵理子", 0, 1, 1027, 1.4, 1, 0, "……クスクス…私は\n…倉石恵理子……", "離しませんわ………\n絶対に…!!", 0, 0, 2, "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "佐々木 咲恋", 0, 1, 1028, 1.4, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "…そうでしょ？？", 0, 0, 2, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "桜井 望", 0, 1, 1029, 1.4, 1, 0, "桜井望だよ！\nよろしくねっ", "あはは、\n私もまだまだだなぁ～", 0, 0, 2, "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "ニノン・ジュベール", 0, 1, 1030, 1.4, 1, 0, "デケデケデンっ！", "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, 2, "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "上喜 しのぶ", 0, 1, 1031, 1.4, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", "おかしいですね……", 0, 0, 2, "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "野戸まひる", 0, 1, 1033, 1.5, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", "そう、\nオラのボケに突っ込める相方が…！", 0, 0, 2, "けんども\nそれには足りないモンが…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "綾瀬 ゆかり", 0, 1, 1034, 1.4, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょ\nちょっと一杯飲んできます…！", 0, 0, 2, "ちょっと緊張しちゃって…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "氷川 鏡華", 0, 1, 1036, 1.5, 1, 0, "氷川鏡華…です", "これ以上お話しすることは…\nないです！", 0, 0, 2, "知らない人とは話しちゃいけないので");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "柏崎 栞", 0, 1, 1038, 1.4, 1, 0, "柏崎…栞です。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, 2, "……あ、アラーム。");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "双葉 碧", 0, 1, 1040, 1.4, 1, 0, "ふ、双葉碧です。", "野に咲く花が、\n唯一の話相手です。", 0, 0, 2, "私、一人も友達がいなくて……");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "三角 千歌", 0, 1, 1042, 1.4, 1, 0, "三角千歌です。", "そう思っています。", 0, 0, 2, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "安芸 真琴", 0, 1, 1043, 1.4, 1, 0, "安芸真琴だ。", "う、疑ってすまなかったな…", 0, 0, 2, "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "イリヤ・オーンスタイン", 0, 1, 1044, 1.4, 1, 0, "わらわこそは夜を総べる者！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, 2, "生けとし生ける全ての者よ！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "遠見 空花", 0, 1, 1045, 1.4, 1, 0, "そこで騎士は妖精を乱暴に……", "ｌク、クウカに何かご用ですか!?", 0, 0, 2, "ぐふふふふ……はっ！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "宮坂たまき", 0, 1, 1046, 1.4, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, 2, "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "大神 美冬", 0, 1, 1048, 1.4, 1, 0, "大神美冬よ！", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, 2, "それでは早速クエストに…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "星野静流", 0, 1, 1049, 1.4, 1, 0, "星野静流だよ！", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, 2, "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "玉泉美咲", 0, 1, 1050, 1.5, 1, 0, "アタシは玉泉美咲。", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, 2, "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "リマ", 0, 1, 1052, 1.4, 1, 0, "？？？", "？？？？", 0, 0, 2, "？？？？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "モニカ・ヴァイスヴィント", 0, 1, 1053, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 0, 2, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "ペコリーヌ", 0, 1, 1058, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 0, 2, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "コッコロ", 0, 1, 1059, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 0, 2, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, 1, "キャル", 0, 1, 1060, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 0, 2, "菓子でつろうなどと\n稚拙な策を……");
